// Modal.jsx
import {us}from 'react';
import './Modal.css';

const Modal = ({ isOpen, onClose, onOption1Click, onOption2Click }) => {
  return (
    <div className={`modal ${isOpen ? 'open' : ''}`}>
      <div className="modal-content">
        <span className="close" onClick={onClose}>&times;</span>
        <p>Selecciona una opción:</p>
        <button onClick={onOption1Click}>Llenar formulario para registrar equipo</button>
        <button onClick={onOption2Click}>Registrarse en un equipo existente</button>
      </div>
    </div>
  );
};








const App = () => {
  const [modalOpen, setModalOpen] = useState(false);

  const openModal = () => {
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  const handleOption1Click = () => {
    // Redireccionar o realizar acciones para la opción 1
    console.log('Opción 1 clickeada');
    closeModal();
  };

  const handleOption2Click = () => {
    // Redireccionar o realizar acciones para la opción 2
    console.log('Opción 2 clickeada');
    closeModal();
  };

  return (
    <div>
      <button onClick={openModal}>Abrir Modal</button>
      <Modal
        isOpen={modalOpen}
        onClose={closeModal}
        onOption1Click={handleOption1Click}
        onOption2Click={handleOption2Click}
      />
    </div>
  );
};

export default App;
